<p>FRUTAS</p>
<ul>
    <li>PIÑA</li>
    <P> Ananas comosus es una especie de la familia de las bromeliáceas, nativa de América del Sur.
        Planta de escaso porte y con hojas duras y lanceoladas de hasta 1 m de largo,
        fructifica
        una vez al año produciendo un único fruto fragante y dulce, muy apreciado en gastronomía.</p>
    <img src="data:image/jpeg;base64,">

    <li>PATILLA</li>
    <P> Citrullus lanatus, comúnmente llamada sandía, acendría, síndria, patilla, aguamelón o melón de agua
        es una especie de la familia Cucurbitaceae originaria de África, pero tiene una gran presencia
        y difusión en Asia.</p>
    <img src="https://sandiapedia.com/wp-content/uploads/2017/04/origen-de-la-sandia.jpg">

    <li>MELON</li>
    <P> Cucumis melo, llamado comúnmente melón, es una especie de la familia de las cucurbitáceas.
        Domesticada hace más de 4000 años en la región mediterránea oriental y Asia occidental, el origen
        exacto de la especie silvestre es aún desconocido. </p>
    <img src="data:image/jpeg;base64,">

    <li>BANANO</li>
    <P> La banana,  plátano, guineo, banano, maduro, cambur o gualele, es un fruto comestible, botánicamente
        una baya, de varios tipos de grandes plantas herbáceas del género Musa. A estas plantas de gran
        porte que tienen aspecto de arbolillo se las denomina plataneras, bananeros, bananeras, plátanos
        o bananos. </p>
    <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn%3AANd9GcRH7fLwoHTSUGkvUXdK2vPoR-qhkCO9a5pHug&usqp=CAU">

    <li>MANDARINA</li>
    <P> La mandarina es el fruto ​ de las diferentes especies de cítricos llamados
        comúnmente mandarino, entre ellas Citrus reticulata, Citrus
        unshiu, Citrus reshni, así como sus híbridos, incluyendo Citrus ×
        tangerina, cuya taxonomía está discutida </p>
    <img src="data:image/jpeg;base64,">

    <li>FRESA</li>
    <P> Fragaria, llamado comúnmente fresa o frutilla, es un género de plantas rastreras estoloníferas
        de la familia Rosaceae. Agrupa unos 400 taxones descritos, de los cuales solo unos 20 están
        aceptados. Son cultivadas por su fruto comestible llamado de la misma manera, fresa o frutilla. </p>
    <img src="data:image/jpeg;base64,">

    <li>MANGO</li>
    <P> El mango es el nombre de las frutas de varias especies de árboles del género
        Mangifera, especialmente de Mangifera indica, y sus numerosos cultivares.</p>
    <img src="data:image/jpeg;base64,">
